  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:05.698925\",\n\t\"name\": \"detroit-lakes-wetland-management-district-annual-narrative-calendar-year-1990\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  Lakes WMD outlines Refuge accomplishments during the 1990 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses the master plan,
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, manpower programs, volunteer programs, funding, safety,
  and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, croplands, grasslands, grazing, haying, fire management, pest
  control, and WPA easements. The wildlife section of the report discusses endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, wildlife propagation, and animal control. The public uses of the Refuge
  described in this report include hunting, trapping, wildlife observation, and law
  enforcement. The equipment and facilities section of the report provides information
  about new construction, equipment replacement, communication systems, computer systems,
  and energy conservation. Cooperative programs, economic uses of the Refuge, and
  items of interest are provided at the end.\",\n\t\"license_title\": \"License Not
